import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'react-bootstrap';

function MenuPage(props) {
  return (
    <>
      <Button variant="outline-light" onClick={props.return}>Back</Button>
    </>
  );
}

export default MenuPage;
